Copy Clipboard Icon : <input  readonly type="text" id="copy-icon" value="" style="border:none; background-color:rgba(255,255,255,0);">
</div>
</div>

<script>
$(document).ready(function() {
  /** Initialize tooltips */
  $('[data-toggle="tooltip"]').tooltip();
    
	function myFunction() {
	  /* Get the text field */
	  var copyText = $("btn-copy");
		copyText.select();
	  /* Select the text field */
	  copyText.select();
	  copyText.setSelectionRange(0, 99999); /*For mobile devices*/

	  /* Copy the text inside the text field */
	  document.execCommand("copy");

	  /* Alert the copied text */
	  alert("Copied the text: " + copyText.value);
	}

  
  
});


$(".btn-copy").click(function(){
	var a = $(this).html();
	var icn = $(a).attr("data-original-title")
	$("#copy-icon").val(icn);

	var copyText = document.getElementById("copy-icon");
	copyText.select();
	copyText.setSelectionRange(0, 99999);
	document.execCommand("copy");
	show_success_message("Copy to Clipboard : " +copyText.value);
	
});
 


</script>
